import React from 'react';
import {Gizmo} from './gizmo';
import {Frame} from './frame';

export class Vehicle extends React.Component {
	constructor(props) {
	  super(props);
	}
	state = {
		 displayFrame: true,      
	}
	render() {
		return (
			<div className='vehicle' id={'vehicleId' + this.props.currentVehicleId}>
				<Gizmo onCreateMonster={this.createMonster} currentFrameType={this.props.currentFrameType} />
				<Frame currentFrameType={this.props.currentFrameType} cycleFrameType={this.cycleFrameType} currentFrameOption={this.props.currentFrameOption} resetFrameOption={this.resetFrameOption} />
			</div>
		)
	}
}
